import MyPosts from "./MyPosts";
import { arajin } from "../../../redux/ProfileState.js";
import { connect } from "react-redux";

let mapStateToProps = (state) => {
  return {
    mymsg: state.messagePage.mymsg,
    adText: state.messagePage.adText,
  };
};

let mapDispatchToProps = (dispatch) => {
  return {
    add: (text) => {
      dispatch(arajin(text));
    },
  };
};

const PostsMyPage = connect(mapStateToProps, mapDispatchToProps)(MyPosts);

export default PostsMyPage;
